import React, { useState, useEffect } from 'react'

function Home() {
  const [users, setUsers] = useState([])

  const fetchUsers = () => {
    fetch('http://localhost:8080/api/users')
      .then(response => response.json())
      .then(data => {
        if (Array.isArray(data)) {
          setUsers(data)
        } else {
          console.error('Fetched data is not an array:', data)
        }
      })
      .catch(error => console.error('Error fetching users:', error))
  }

  return (
    <div>
      <h2>Users</h2>
      <div>
        <button onClick={fetchUsers}>Fetch User Names</button>
        {users.map(user => (
          <div key={user.id}>
            <button>{user.name} - Savings</button>
            <button>{user.name} - Checking</button>
            <button>{user.name} - Business</button>
          </div>
        ))}
      </div>
    </div>
  )
}

export default Home
